import { useState } from "react";
import { Food } from "../../models/Food";
import { foodTile } from "../../models/FoodComp";
import { CardSlider, CartBox, GridBox, Mainbox } from "../../style";
import { FoodData } from "../../testData/FoodData";
import { sortFoodBy } from "../functions/sortFoodBy";

export const Main = () => {
  const [food, setFood] = useState<Food[]>(FoodData);
  const inOrder = false;
  console.log(sortFoodBy(food, "name", inOrder));

  function move(e: any) {
    e.target.style.transform = "translate(100%)";
    e.target.style.transition = "0.3s ease-out";
  }

  function moveLeave(e: any) {
    e.target.style.transform = "translate(0)";
  }

  return (
    <Mainbox>
      <GridBox>{food.map((data, index) => foodTile(data))}</GridBox>
      <CartBox>
        <CardSlider onMouseOver={move} onMouseLeave={moveLeave}></CardSlider>
      </CartBox>
    </Mainbox>
  );
};
